import React from "react";
import "./contact.css";

export default function Contact() {
  return (
    <section className="about-main section-main" id="prices">
      <div className="about-title">
        <h2>İletişim</h2>
        <h4>Yardım Madası</h4>
        <div className="section-line"> </div>
      </div>
      <div className="contact">
        <form className="form">
          <input type="text" name="Firstname" placeholder="Adınızı Girin." />
          <input type="text" name="Surname" placeholder="Soyadınızı Girin." />
          <input type="email" name="Email" placeholder="Epostabuzu Girin." />
          <textarea placeholder="Detay girin">Detay</textarea>
          <button>jhabhjav</button>
        </form>
      </div>
    </section>
  );
}
